import React, {Component} from 'react'
//import './OptionsList.css'

class OptionsList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            optionsState: 'emp'
        }
    }

    render() {
        return(
            <div id='oList'>
                <p>My Patients</p>
                <p>Aquire Patients</p>
            </div>
        )
    }
}

export default OptionsList;
